import './App.css';
import FooterComponent from './Component/FooterComponent';
import HeaderComponent from './Component/HeaderComponent';
import ListUserComponent from './Component/ListUserComponent';
import LoginForm from './Component/LoginForm';
import SignupForm from './Component/SigupFrom';
import VerifyEmail from './Component/VerifyEmailComponent'; 
import UserComponent from './Component/UserComponents';
import Home from './Home';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
function App() {
  return (
    <div className="App">

      <BrowserRouter>
      <HeaderComponent />
      <Routes>

         {/* <Route path='/api/v1/' element={<UserComponent />}></Route> */}

          <Route path='/api/v1/auth/signin' element={<LoginForm />}></Route>
          <Route path='/api/v1/auth/signup' element={<SignupForm />}></Route>
          <Route path="/api/v1/auth/verify" element={<VerifyEmail />} />
      </Routes>
      <Home />
      <FooterComponent />
      </BrowserRouter>
    </div>
  );
}

export default App;
